import React, { useEffect, useState } from 'react';
import Header from "../components/Header";
import axios from 'axios';
import './Profile.css';

const Profile = () => {
  const [userData, setUserData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
    sessionInfo: []
  });

  useEffect(() => {
    // 프로필 조회 API 호출
    axios.get(`/dailband/user/{user_id}/profile`)
      .then(response => {
        setUserData(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the profile!', error);
      });
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUserData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (userData.password !== userData.confirmPassword) {
      alert('Passwords do not match!');
      return;
    }
    // 프로필 수정 API 호출
    axios.put(`/dailband/user/{user_id}/profile`, userData)
      .then(response => {
        alert('Profile updated successfully!');
      })
      .catch(error => {
        console.error('There was an error updating the profile!', error);
      });
  };

  return (
    <div className="profile-page">
      <Header />
      <div className="sidebar">
        <img src="/path/to/profile-image" alt="Profile" className="profile-image" />
        <h2>{userData.username}</h2>
        <ul>
          <li className="active">프로필 수정</li>
          <li>스크랩</li>
          <li>내가 쓴 글</li>
          <li>공연 예약</li>
        </ul>
      </div>
      <div className="profile-form-container">
        <h1>마이페이지</h1>
        <form onSubmit={handleSubmit}>
          <label>
            닉네임:
            <input type="text" name="username" value={userData.username} onChange={handleChange} />
          </label>
          <label>
            이메일:
            <input type="email" name="email" value={userData.email} onChange={handleChange} />
          </label>
          <label>
            비밀번호 변경:
            <input type="password" name="password" value={userData.password} onChange={handleChange} />
          </label>
          <label>
            비밀번호 확인:
            <input type="password" name="confirmPassword" value={userData.confirmPassword} onChange={handleChange} />
          </label>
          <label>
            세션 정보:
            <select name="sessionInfo" multiple value={userData.sessionInfo} onChange={handleChange}>
              <option value="드럼">드럼</option>
              <option value="기타">기타</option>
              <option value="보컬">보컬</option>
              <option value="베이스">베이스</option>
              <option value="키보드">키보드</option>
            </select>
          </label>
          <button type="submit">수정</button>
        </form>
      </div>
    </div>
  );
};

export default Profile;
